import React from "react";
import { useState } from "react";


function OptionPopup() {
    const [showPopup, setShowPopup] = useState(false);

    return (
        <div>
            <button onClick={() => setShowPopup(!showPopup)}>Toggle Popup</button>
            {showPopup && (
                <div>
                    <h1>Popup Content</h1>
                    <p>This is a popup</p>
                </div>
            )}
        </div>
    );
}

export default OptionPopup;
